import { Link } from "react-router-dom";
import EventsNavigation from "../components/EventsNavigation";

const DUMMY_EVENTS = [
    {
        id: 1,
        name: 'Event 1',
    },
    {
        id: 2,
        name: 'Event 2'
    }
];

const EventsPage = () => {
    return (
        // <h1>EventsPage</h1>
        <>
            <EventsNavigation />
            <ul>
                {DUMMY_EVENTS.map(event => 
                    <li>
                        <Link to={`/events/${event.id}`}>{event.name}</Link>
                    </li>
                )}
            </ul>
        </>
    );
}

export default EventsPage;
